<head>
    <meta charset="utf-8">
    <title>Descent quest builder</title>
<link rel="stylesheet" type="text/css" href="css/bootstrap/bootstrap.css"><link rel="stylesheet" type="text/css" href="css/general.css"><link rel="stylesheet" type="text/css" href="css/scrollbar.css"><script type="text/javascript" src="js/draggable.js"></script><script type="text/javascript" src="js/logic.js"></script><script type="text/javascript" src="js/text_script.js"></script><script type="text/javascript" src="js/loadTiles.js"></script><script>if (typeof module === 'object') { window.module = module; module = undefined; }</script><script src="js/jquery/jquery-3.4.1.min.js"></script><script src="js/jquery/jquery-ui.js"></script><script type="text/javascript" src="js/bootstrap/bootstrap.js"></script><script src="js/html2canvas/html2canvas.js"></script><script src="js/html2canvas/jspdf.debug.js"></script><script src="js/fileSaver/FileSaver.js"></script><script>if (window.module) module = window.module;</script></head>


























<body class="">


    <div class="modal fade" id="loadProjectModal" tabindex="-1" role="dialog" aria-hidden="true">
        <div class="modal-dialog modal-full" role="document">
            <div class="modal-content">
                <div class="modal-header">
                    <h2 class="modal-title">select one of the saved missions to reload</h2>
                    <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <h1 aria-hidden="true">×</h1>
                    </button>
                </div>
                <div class="modal-body p-4 funny_scrollbar_blue" id="result">
                    <div class="row">
                        <div class="col-12">
                            <table class="bigtable table table-hover table-striped table-inverse table-responsive">
                                <thead class="thead-inverse">
                                    <tr>
                                        <th></th>
                                        <th>mission name</th>
                                        <th>date</th>
                                    </tr>
                                </thead>
                                <tbody id="save_list">
                                    
                                </tbody>
                            </table>
                        </div>
                        
                    </div>
                </div>
            </div>
        </div>
    </div>

    <div class="modal fade" id="saveProjectModal" tabindex="-1" role="dialog" aria-hidden="true">
        <div class="modal-dialog modal-center" role="document">
            <div class="modal-content">
                <div class="modal-header">
                    <h2 class="modal-title">configure save</h2>
                    <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <h1 aria-hidden="true">×</h1>
                    </button>
                </div>
                <div class="modal-body p-4 funny_scrollbar_blue" id="result">
                    <div class="row">
                        <div class="col-4">
                            <label class="labelBig">mission name :</label>
                        </div>
                        <div class="col-8">
                            <input class="labelBig" style="width: 100%" id="projectSaveName" type="text" placeholder="enter mission name">
                        </div>
                    </div>
                </div>
                <div class="modal-footer">
                    <button class="saveButton" onclick="saveProject()">save</button>
                </div>
            </div>
        </div>
    </div>






    <div class="modal fade" id="outputModal" tabindex="-1" role="dialog" aria-hidden="true" style="display: none;">
        <div class="modal-dialog modal-full" role="document">
            <div class="modal-content">
                <div class="modal-header">
                    <h2 class="modal-title">review output on a4 before exporting on pdf</h2>
                    <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <h1 aria-hidden="true">×</h1>
                    </button>
                </div>
                <div class="modal-body p-4 funny_scrollbar_blue" id="result">
                    <div class="row">
                        <div class="col-6">
                            <h2>settings</h2>
                            <h3>background color</h3>
                            <input id="black_checkbox" onclick="setBlackBackground()" class="checkmark" type="radio" name="background_color"> <label class="labelBig">black (improve readability)</label><br>
                            <input id="white_checkbox" onclick="setWhiteBackground()" class="checkmark" type="radio" name="background_color"><label class="labelBig">white (save ink when
                                printing)</label><br>
                            <input id="smoky_checkbox" onclick="setSmokyBackground()" class="checkmark" type="radio" checked="checked" name="background_color"> <label class="labelBig">smoky (as original
                                questbook)</label><br>
                            <button class="exportPDFButton" onclick="exportPDF()">export to PDF</button>

                            <br>
                            <br>
                            <div class="form-group">
                                <h3 class="labelBig">ZOOM (adapt the dungeon to fit A4 printable page)</h3>
                                <br>
                                <input style="width: 80%" class="rounded_range" type="range" max="2.0" min="0.5" step="0.5" value="1.5" id="zoomScaling" onchange="scaleRes()">

                            </div>
                            <div class="form-group">
                                <h3 class="labelBig">margin left</h3>
                                <br>
                                <input style="width: 80%" class="rounded_range" type="range" max="200" min="-200" step="20" value="0" id="marginLeft" onmouseup="setMarginLeft()" ontouchend="setMarginLeft()">

                            </div>
                            <div class="form-group">
                                <h3 class="labelBig">margin top</h3>
                                <br>
                                <input style="width: 80%" class="rounded_range" type="range" max="200" min="-200" step="20" value="0" id="marginTop" onmouseup="setMarginTop()" ontouchend="setMarginTop()">

                            </div>
                        </div>
